                  />
                )}
                no={() => (
                  <Route component={asyncComponent(() => import('../../../components/Error404'))} />
                )}
              />
            )}
          </RoleContext.Consumer>
        )}
      />
      <Route
        path={`${match.url}/subjectsSettings`}
        render={() => (
          <RoleContext.Consumer>
            {({ role }) => (
              <Can
                role={role}
                perform="module-nav-access"
                data={{
                  mod: 'administration',
                  moduleList: estabModule,
                }}
                yes={() => (
                  <Can
                    role={role}
